package Assignment0;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a, b, temp; 
	    a = 10;
	    b = 20;

	    temp = a;
	    a = b;
	    b = temp;

	    System.out.printf("After Swap\n");
	    System.out.printf("a = %d\n", a); 
	    System.out.printf("b = %d\n", b); 

	}

}
